      $('#reporte').click(function(){
        var name = prompt('What is your name?');
        var multiplier = prompt('Enter a number:');
        multiplier = parseInt(multiplier);

        var doc = new jsPDF('landscape');
        doc.setFontSize(10);
        doc.text(60, 20, 'SECRETARÍA DE EDUCACIÓN \n');
        doc.text(50, 25, 'REGISTRO DE MATRÍCULA POR FACILITADOR DE 1° a 6° \n');
        doc.setFontSize(12);
        doc.text(40, 30, 'DIRECCIÓN GENERAL DE MODALIDADES EDUCATIVAS \n');
        doc.text(30, 35, 'SUB-DIRECCIÓN GENERAL DE EDUCACIÓN PARA JOVENES Y ADULTOS \n');

        for(var i = 1; i <= 12; i ++) {
            doc.text(20, 30 + (i * 10), i + ' x ' + multiplier + ' = ___');
        }

        doc.addPage();
        doc.setFontSize(22);
        doc.text(20, 20, 'Answers');
        doc.setFontSize(16);

        for(var i = 1; i <= 12; i ++) {
            doc.text(20, 30 + (i * 10), i + ' x ' + multiplier + ' = ' + (i * multiplier));
        }
        doc.save('Test.pdf');
      });
    

